patch:
diff --git a/icu4c/source/i18n/regexcmp.cpp b/icu4c/source/i18n/regexcmp.cpp
index a4c12804237..d8236bf3d01 100644
--- a/icu4c/source/i18n/regexcmp.cpp
+++ b/icu4c/source/i18n/regexcmp.cpp
@@ -4019,9 +4019,26 @@ void RegexCompile::nextChar(RegexPatternChar &c) {
         c.fQuoted = TRUE;
         if ((c.fChar==chBackSlash && peekCharLL()==chE && ((fModeFlags & UREGEX_LITERAL) == 0)) ||
             c.fChar == (UChar32)-1) {
-            fQuoteMode = FALSE;  //  Exit quote mode,
+// FIXME: Crash CWE-834: Excessive Iteration
+             fQuoteMode = FALSE;  //  Exit quote mode,
             nextCharLL();        // discard the E
-            nextChar(c);         // recurse to get the real next char
+            // Use iterative approach instead of recursive call
+            bool needsReprocessing = true;
+            while (needsReprocessing) {
+                c.fChar = nextCharLL();
+                c.fQuoted = FALSE;
+                needsReprocessing = false;
+                
+                if (fQuoteMode) {
+                    c.fQuoted = TRUE;
+                    if ((c.fChar==chBackSlash && peekCharLL()==chE && ((fModeFlags & UREGEX_LITERAL) == 0)) ||
+                        c.fChar == (UChar32)-1) {
+                        fQuoteMode = FALSE;
+                        nextCharLL();
+                        needsReprocessing = true;
+                    }
+                }
+            }
         }
     }
     else if (fInBackslashQuote) {
@@ -4031,8 +4048,7 @@ void RegexCompile::nextChar(RegexPatternChar &c) {
         //    dispatching on the character.
         fInBackslashQuote = FALSE;
     }
-    else
-    {
+    else    {
         // We are not in a \Q quoted region \E of the source.
         //
         if (fModeFlags & UREGEX_COMMENTS) {
@@ -4138,9 +4154,18 @@ void RegexCompile::nextChar(RegexPatternChar &c) {
             }
             else if (peekCharLL() == chQ) {
                 //  "\Q"  enter quote mode, which will continue until "\E"
-                fQuoteMode = TRUE;
+// FIXME: Crash CWE-834: Excessive Iteration
+                 fQuoteMode = TRUE;
                 nextCharLL();       // discard the 'Q'.
+                // Prevent infinite recursion by using a depth counter
+                static int recursionDepth = 0;
+                if (recursionDepth >= 100) {
+                    error(U_REGEX_STACK_OVERFLOW);
+                    return;
+                }
+                recursionDepth++;
                 nextChar(c);        // recurse to get the real next char.
+                recursionDepth--;
             }
             else
             {
